import{_ as a,c as t,o as e,a4 as p}from"./chunks/framework.DBIahkuf.js";const u=JSON.parse('{"title":"提示词等工具网站","description":"","frontmatter":{},"headers":[],"relativePath":"Document/AI绘画工具/提示词等工具网站.md","filePath":"Document/AI绘画工具/提示词等工具网站.md","lastUpdated":1689751952000}'),r={name:"Document/AI绘画工具/提示词等工具网站.md"},o=p('<h1 id="提示词等工具网站" tabindex="-1">提示词等工具网站 <a class="header-anchor" href="#提示词等工具网站" aria-label="Permalink to &quot;提示词等工具网站&quot;">​</a></h1><p><a href="https://wx.zsxq.com/dweb2/index/topic_detail/412248555525558" target="_blank" rel="noreferrer">『设计师专用单词表』AI绘画小白掌握风格提示词的极速教程 (zsxq.com)</a></p><p>有了AI绘画工具却，在写提示词时头脑空空？烦透了来回尝试提示词，却都不是自己想要的效果？<strong>那你一定需要这份134页的宝藏资料！</strong></p><p>Simon 分享了工作室内部使用的设计师单词表，每两页PPT介绍一个关键词，不仅有关键词的中英文，还详细地解释了含义，搜索结果示例、优秀设计样例，并分享了更多拓展资料和工具。<strong>对于AI绘画小白来说，这份PPT 简直是及时雨 &amp; 活菩萨！</strong></p><p><a href="https://www.jrnylist.com/" target="_blank" rel="noreferrer">Jrnylist</a>（关键词参考）：Jrnylist是一个基于关键词参考的工具，帮助您更高效地生成与特定关键词相关的文章和内容，为您的创作提供强大支持。</p><p><a href="https://prompt.noonshot.com/" target="_blank" rel="noreferrer">Noonshot</a>（生成Midjourney关键词）：Noonshot是一款专注于生成Midjourney关键词的工具，能够根据您的需求生成有针对性的关键词，助力您在创作过程中找到灵感。</p><p><a href="https://www.prompthunt.com/" target="_blank" rel="noreferrer">Prompt Hunt</a>（DALL·E和Midjourney绘画）：Prompt Hunt结合DALL·E和Midjourney技术，提供一款功能强大的绘画工具，让您能够轻松创作出令人惊艳的艺术作品。</p><p><a href="https://promptbase.com/" target="_blank" rel="noreferrer">PromptBase</a>（DALL·E,Midjourney,ChatGPT,Stable Diffusion绘画）：利用了多种先进的人工智能技术，包括DALL·E、Midjourney、ChatGPT和Stable Diffusion绘画技术，使得PromptBase成为一个强大的内容生成与扩充平台。</p><h2 id="_1、ai提示词-prompt-工具库" tabindex="-1">1、AI提示词（Prompt）工具库 <a class="header-anchor" href="#_1、ai提示词-prompt-工具库" aria-label="Permalink to &quot;1、AI提示词（Prompt）工具库&quot;">​</a></h2><p>官网：<a href="https://prompthero.com/" target="_blank" rel="noreferrer">https://prompthero.com/</a></p><p>非常全的提示词网站，除了提供Midjourney、Stable-Diffusion、DALL-E这些绘画工具的提示词，还提供了大量的ChatGPT提示词，你可以直接复制提示词使用，快速做出类似的图片。</p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/5b2cac1d43984a6998383ec39ad69e91~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420163242.jpg"></p><p><img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/76527ce9eb194786bf6d11e65299f0c7~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420172000.jpg"></p><h2 id="" tabindex="-1"><a class="header-anchor" href="#" aria-label="Permalink to &quot;&quot;">​</a></h2><h2 id="_2、midjourney关键词助手" tabindex="-1">2、Midjourney关键词助手 <a class="header-anchor" href="#_2、midjourney关键词助手" aria-label="Permalink to &quot;2、Midjourney关键词助手&quot;">​</a></h2><p>官网：<a href="https://prompt.noonshot.com/" target="_blank" rel="noreferrer">https://prompt.noonshot.com/</a></p><p>专门的Midjourney关键词助手，在这个网站，你可以根据网站提供的选择，设置关键词的风格组合，包括图片风格、艺术家、颜色、大小以及景深程度等。</p><p><img src="https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/41b3db5e28cc4afbb2ece64f008a5f59~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420171849.jpg"></p><p><img src="https://p9-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/ad920c375c2c42fbb2bf4eb3757f4a0f~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420163356.jpg"></p><h2 id="-1" tabindex="-1"><a class="header-anchor" href="#-1" aria-label="Permalink to &quot;&quot;">​</a></h2><h2 id="_3、prompt-hunt" tabindex="-1">3、Prompt Hunt <a class="header-anchor" href="#_3、prompt-hunt" aria-label="Permalink to &quot;3、Prompt Hunt&quot;">​</a></h2><p>官网：<a href="https://www.prompthunt.com/" target="_blank" rel="noreferrer">https://www.prompthunt.com/</a></p><p>提供了很多设计精美的AI生成图，可以直接复制对应图片的提示词。</p><p><img src="https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/b12d48bd12f04be99dfaadaf53714e91~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420163526.jpg"></p><h2 id="_4、promptbase" tabindex="-1">4、PromptBase <a class="header-anchor" href="#_4、promptbase" aria-label="Permalink to &quot;4、PromptBase&quot;">​</a></h2><p>官网：<a href="https://promptbase.com/" target="_blank" rel="noreferrer">https://promptbase.com/</a></p><p>提供了大量AI绘画提示词，部分提示词需要付费才能复制，也可以上传自己的提示词变现。</p><p><img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/0d1d7f9d829b4d53bd55dad846b50d80~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420164006.jpg"></p><h2 id="_5、ai画廊" tabindex="-1">5、Ai画廊 <a class="header-anchor" href="#_5、ai画廊" aria-label="Permalink to &quot;5、Ai画廊&quot;">​</a></h2><p>官网：<a href="https://www.aigallery.top/aigjz?c2=15&amp;c3&amp;c4&amp;t" target="_blank" rel="noreferrer">https://www.aigallery.top/aigjz?c2=15&amp;c3&amp;c4&amp;t</a></p><p>国内比较不错的提示词网站</p><p><img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/10ee1a12d7be43f785ed882c7720fd39~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420164101.jpg"></p><h2 id="_6、phraser" tabindex="-1">6、Phraser <a class="header-anchor" href="#_6、phraser" aria-label="Permalink to &quot;6、Phraser&quot;">​</a></h2><p>官网：<a href="https://phraser.tech/inspiration" target="_blank" rel="noreferrer">https://phraser.tech/inspiration</a></p><p>提供了海量的AI图片，可以直接复制图片的提示词用于AI作图，也可以根据图片风格选择提示词。</p><p><img src="https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/027027ad8f0a4d89911a0b3684019587~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420164341.jpg"></p><h2 id="_7、ai绘画风格库" tabindex="-1">7、AI绘画风格库 <a class="header-anchor" href="#_7、ai绘画风格库" aria-label="Permalink to &quot;7、AI绘画风格库&quot;">​</a></h2><p>官网：<a href="https://lib.kalos.art/" target="_blank" rel="noreferrer">https://lib.kalos.art/</a></p><p>提供了众多艺术家和图片设计流派可供参考和使用，也可以建立自己的风格库进行收藏。</p><p><img src="https://p6-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/5a31a726072a45d08f45518bfc44c7c8~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420164504.jpg"></p><h2 id="_8、playgroundai" tabindex="-1">8、Playgroundai <a class="header-anchor" href="#_8、playgroundai" aria-label="Permalink to &quot;8、Playgroundai&quot;">​</a></h2><p>官网：<a href="https://playgroundai.com/" target="_blank" rel="noreferrer">https://playgroundai.com/</a></p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/00586523a7fd45c995637c9c2a05284b~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420164622.jpg"></p><h2 id="_9、-ai-导航-一起用-ai" tabindex="-1">9、（AI 导航）一起用 AI <a class="header-anchor" href="#_9、-ai-导航-一起用-ai" aria-label="Permalink to &quot;9、（AI 导航）一起用 AI&quot;">​</a></h2><p>官网：<a href="https://17yongai.com/" target="_blank" rel="noreferrer">17yongai.com</a></p><p>比较全的一个AI导航网站，提供了Midjourney、Stable Diffusion、ChatGPT等使用教程，也有非常多的AI工具分类。</p><p><img src="https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/5f591583c06446d2bf02c65ae4241ee6~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420164741.jpg"></p><h2 id="_10、-ai-导航-futurepedia" tabindex="-1">10、（AI 导航）Futurepedia <a class="header-anchor" href="#_10、-ai-导航-futurepedia" aria-label="Permalink to &quot;10、（AI 导航）Futurepedia&quot;">​</a></h2><p>官网：<a href="https://www.futurepedia.io/" target="_blank" rel="noreferrer">Futurepedia - The Largest AI Tools Directory | Home</a></p><p>收集了1900多个AI工具，54个分类，AI工具比较齐全，可以一键收藏喜欢的AI工具。</p><p><img src="https://p1-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/eb2f8da4569a4494a8eea8554bcf42e9~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420164906.jpg"></p><h2 id="_11、词图prompttool" tabindex="-1">11、词图PromptTool <a class="header-anchor" href="#_11、词图prompttool" aria-label="Permalink to &quot;11、词图PromptTool&quot;">​</a></h2><p>官网：<a href="https://prompttool.com/NovelAI?goLogin=1" target="_blank" rel="noreferrer">https://prompttool.com/NovelAI?goLogin=1</a></p><p>提供了大量的AI图片，可以打开图片后，查看该图片的提示词，复制对应的提示词可以直接画图。</p><p><img src="https://p3-juejin.byteimg.com/tos-cn-i-k3u1fbpfcp/00dd23dedcee41db91b72cbf5179a08a~tplv-k3u1fbpfcp-zoom-in-crop-mark:1512:0:0:0.awebp?" alt="Dingtalk_20230420165310.jpg"></p>',55),i=[o];function n(c,l,h,m,s,f){return e(),t("div",null,i)}const d=a(r,[["render",n]])